    function func(address addr) public {
      uint[] memory newArray = new uint[](3);
      newArray[0] = 1;
      newArray[1] = 2;
      newArray[2] = 3;
      
      (bool success,) = addr.delegatecall(abi.encodeWithSignature("func(uint256[])",newArray));
      if(!success){
